export default function EventsPage(){
    async function fetchEvents(){
        const response=fetch("http://localhost:8080/even",{
            method:"GET"
        })
        const events=await response.json();
        console.log(events)
    }
    fetchEvents()
    return(
        <h1>Events Page</h1>
    )
}
